export const WatchlistBtn = ({className, fullwidth}) =>{
  return(
    <div className={'d-flex m-justify-content-center'}>
      <div className={fullwidth ? `secondary-bg-color secondary-btn fullwidth white-color paragraph-bold ${className}`: `secondary-bg-color secondary-btn white-color paragraph-bold ${className}`}> Add to watchlist
      </div>
    </div>
  )
}
